import React from 'react';
import './account-option-popover.css';

export default function AccountOptionPopover(){

    const options=["Settings","Log in"]
    return(
        <div>

            {options.map((option,index)=> <div key={index } className="acc-option-popover"> {option} </div>)}
        </div>
    )
}
